def is_rule(obj):
    if obj.triangle:
        return obj.small
    elif obj.circle:
        return obj.medium
    elif obj.rectangle:
        return obj.large

def is_rule(obj):
    unique_combination = obj.color + obj.size + obj.shape
    return len([o for o in obj.group if o.color + o.size + o.shape == unique_combination]) == 1
